import logo from './logo.svg';
import './App.css';
import Menu from './Menu.js';
import Illustrations from './Illustrations.js';
// import hic from './img/hic.jpg';
import {BrowserRouter, Switch, Route,} from "react-router-dom";

function App() {
  return (
    <div> 
      <Menu/>
      <BrowserRouter>
            <div>
                <Switch>
                    <Route exact path='/login' component={Login} />
                    <PrivateRoute exact path='/' component={Entrance} />
                    <PrivateRoute exact path='/insertrate' component={InsertRate} />
                    <PrivateRoute exact path='/monthlydetails' component={MonthlyDetails} />
                    <PrivateRoute exact path='/reviewperiod' component={ReviewPeriod} />
                    <PrivateRoute exact path='/suggestion' component={Suggestion} />
                    <PrivateRoute exact path='/askassetformation' component={AskAssetFormation} />
                    <PrivateRoute exact path='/askrisktolerance' component={AskRiskTolerance} />
                    <PrivateRoute exact path='/askcuriousinformation' component={AskCuriousInformation} /> 
                    <PrivateRoute exact path='/result' component={Result} /> 
                </Switch>
            </div>
        </BrowserRouter>
      <Illustrations/>
    </div>

  );
}

export default App;
